import React, {Component} from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    const fs = require("fs");
    this.state = {
      text: fs.readFileSync("sample.txt", "utf-8"),
      text: "fkdlsa",
    };
  }
  render() {
    return <div>{this.text}</div>;
  }
}

export default App;
